import styled from "styled-components";

const Input = styled.input`
  background:none;
  border: 1px solid #777;
  border-radius: 3px;
  display: block;
  width:100%;
  box-sizing: border-box;
  padding: 10px;
  margin-bottom: 20px;
  color:#000;
`;

export default Input;
